--4. Вывести названия(productname), описания категорий(categorydescription) и количества(quantity) тех продуктов, у которых минимальная стоимость (min_price) больше 300.
--4. Display the names (productname), CATEGORY_DESCRIPTIONs (categorydescription) and quantities (quantity) of those products with a minimum price (min_price) greater than 300.
select t1.PRODUCT_NAME, t2.CATEGORY_DESCRIPTION, t3.QUANTITY
from product_information t1
inner join categories_tab t2
on t1.CATEGORY_ID = t2.CATEGORY_ID
inner join order_items t3
on t1.PRODUCT_ID = t3.PRODUCT_ID
where t1.MIN_PRICE > 300;

