--5. Вывести имя, фамилию покупателей, которые купили принтеры.
--5. Display the first and last name of the customers who bought the printers.

select t1.CUST_FIRST_NAME, t1.CUST_LAST_NAME
from customers t1
inner join orders t2
on t1.CUSTOMER_ID = t2.CUSTOMER_ID
inner join order_items t3
on t2.ORDER_ID = t3.ORDER_ID
inner join product_information t4
on t3.PRODUCT_ID = t4.PRODUCT_ID
inner join categories_tab t5
on t4.CATEGORY_ID = t5.CATEGORY_ID
where t5.CATEGORY_DESCRIPTION like 'printers';

--Elia	Fawcett

--6. Вывести имя, фамилию всех женатых мужчин покупателей, которые покупали продукты со стоимостью (list_price) больше 550.
--6. Print the first and last names of all married male customers who bought products with a cost (list_price) of more than 550.
select t1.CUST_FIRST_NAME, t1.CUST_LAST_NAME, t4.LIST_PRICE
from customers t1
join orders t2
on t1.CUSTOMER_ID = t2.CUSTOMER_ID
join order_items t3
on t2.ORDER_ID = t3.ORDER_ID
join product_information t4
on t3.PRODUCT_ID = t4.PRODUCT_ID
where t1.MARITAL_STATUS like 'married' && t1.GENDER like 'M' && t4.LIST_PRICE > 550;

--null

--7. Вывести названия(product_name) тех продуктов, у которых стоимость больше, чем у продукта 'LaserPro 600/6/BW’.
--7. Display the names (product_name) of those products whose cost is greater than the product 'LaserPro 600/6/BW'.
select t1.PRODUCT_NAME
from product_information t1
join order_items t2
on t1.PRODUCT_ID = t2.PRODUCT_ID
where t2.UNIT_PRICE > (
			select t2.UNIT_PRICE
			from  order_items t2
            join product_information t1
            on  t2.PRODUCT_ID = t1.PRODUCT_ID
